import L from 'leaflet';
import available from '../media/laddel_available.png'
import unavailable from '../media/laddel_unavailable.png'
import pending from '../media/laddel_pending.png'

/**
 * Implements custom icons for leaflet
 * @author Sven
 * @version 09/08/2021
 */
const iconAvailable = new L.Icon({
    iconUrl: available,
    iconRetinaUrl: available,
    iconSize: new L.Point(32, 32),
    className: 'leaflet-div-icon'
});

const iconUnavailable = new L.Icon({
    iconUrl: unavailable,
    iconRetinaUrl: unavailable,
    iconSize: new L.Point(32,32),
    className: 'leaflet-div-icon'
});

const iconPending = new L.Icon({
    iconUrl: pending,
    iconRetinaUrl: pending,
    iconSize: new L.Point(32, 32),
    className: 'leaflet-div-icon'
})
export { iconAvailable, iconUnavailable, iconPending };
